        "hierarchy": "Class Component\n  Constructor constructor\n    ConstructorSignature new Component:Component\n      Parameter options:object\n  Property ___args__:any\n  Property bounds:Bounds\n  Property debugName:string | null\n  Accessor args\n    GetSignature __get:any\n    SetSignature __set:void\n      Parameter args:any\n  Accessor element\n    GetSignature __get:HTMLElement\n  Method destroy\n    CallSignature destroy:void\n  Method didInsertElement\n    CallSignature didInsertElement:void\n  Method didUpdate\n    CallSignature didUpdate:void\n  Method toString\n    CallSignature toString:string\n  Method willDestroy\n    CallSignature willDestroy:void\n  Method create\n    CallSignature create:Component\n      Parameter injections:any",
        "kindString": "Class",
