            "alias": "bounds",
            "fullName": "Component.bounds",
            "hierarchy": "Property bounds:Bounds",
            "kindString": "Property",
            "sources": [
              {
                "fileName": "component.ts",
                "line": 209,
                "character": 8,
                "url": "https://github.com/glimmerjs/glimmer.js/blob/357140a/packages/@glimmer/component/src/component.ts#L209"
              }
            ],
            "comment": {
              "shortText": "<p>Contains the first and last DOM nodes of a component&#39;s rendered template.\nThese nodes can be used to traverse all of the DOM nodes that belong to a\nparticular component.</p>\n",
              "text": "<p>Note that a component&#39;s first and last nodes <em>can</em> change over time, if the\nbeginning or ending of the template is dynamic. You should always access\n<code>bounds</code> directly at the time a node is needed to ensure you are acting on\nup-to-date nodes.</p>\n<h3 id=\"examples\">Examples</h3>\n<p>For components with a single root element, <code>this.bounds.firstNode</code> and\n<code>this.bounds.lastNode</code> are the same.</p>\n<pre><code class=\"lang-hbs\"><span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"user-profile\"</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">Avatar</span> @<span class=\"hljs-attr\">user</span>=</span></span><span class=\"hljs-template-variable\">{{this.user}}</span><span class=\"xml\"><span class=\"hljs-tag\"> /&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\n</code></pre>\n<pre><code class=\"lang-ts\"><span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-keyword\">class</span> <span class=\"hljs-keyword\">extends</span> Component {\n  didInsertElement() {\n    <span class=\"hljs-keyword\">let</span> { firstNode, lastNode } = <span class=\"hljs-keyword\">this</span>.bounds;\n    <span class=\"hljs-built_in\">console</span>.log(firstNode === lastNode); <span class=\"hljs-comment\">// true</span>\n    <span class=\"hljs-built_in\">console</span>.log(firstNode.className); <span class=\"hljs-comment\">// \"user-profile\"</span>\n  }\n}\n</code></pre>\n<p>For components with multiple root nodes, <code>this.bounds.firstNode</code> refers to\nthe first node in the template and <code>this.bounds.lastNode</code> refers to the\nlast:</p>\n<pre><code class=\"lang-hbs\"><span class=\"xml\">Welcome to Glimmer.js!\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">span</span>&gt;</span>Let's build some components!<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">span</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">img</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"logo.png\"</span>&gt;</span></span>\n</code></pre>\n<pre><code class=\"lang-ts\"><span class=\"hljs-keyword\">export</span> <span class=\"hljs-keyword\">default</span> <span class=\"hljs-keyword\">class</span> <span class=\"hljs-keyword\">extends</span> Component {\n  didInsertElement() {\n    <span class=\"hljs-keyword\">let</span> { firstNode, lastNode } = <span class=\"hljs-keyword\">this</span>.bounds;\n\n    <span class=\"hljs-comment\">// Walk all of the DOM siblings from the</span>\n    <span class=\"hljs-comment\">// firstNode to the lastNode and push their</span>\n    <span class=\"hljs-comment\">// nodeName into an array.</span>\n    <span class=\"hljs-keyword\">let</span> node = firstNode;\n    <span class=\"hljs-keyword\">let</span> names = [firstNode.nodeName];\n    <span class=\"hljs-keyword\">do</span> {\n      node = node.nextSibling;\n      names.push(node.nodeName);\n    } <span class=\"hljs-keyword\">while</span> (node !== lastNode);\n\n    <span class=\"hljs-built_in\">console</span>.log(names);\n    <span class=\"hljs-comment\">// [\"#text\", \"SPAN\", \"IMG\"]</span>\n  }\n}\n</code></pre>\n<p>The bounds can change if the template has dynamic content at the beginning\nor the end:</p>\n<pre><code class=\"lang-hbs\"><span class=\"xml\"></span><span class=\"hljs-template-tag\">{{#<span class=\"hljs-name\"><span class=\"hljs-builtin-name\">if</span></span> user.isAdmin}}</span><span class=\"xml\">\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">span</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"warning\"</span>&gt;</span>Admin<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">span</span>&gt;</span>\n</span><span class=\"hljs-template-variable\">{{<span class=\"hljs-builtin-name\">else</span>}}</span><span class=\"xml\">\n  Normal User\n</span><span class=\"hljs-template-tag\">{{/<span class=\"hljs-name\"><span class=\"hljs-builtin-name\">if</span></span>}}</span><span class=\"xml\"></span>\n</code></pre>\n<p>In this example, the <code>firstNode</code> will change between a <code>span</code> element and a\n<code>TextNode</code> as the <code>user.isAdmin</code> property changes.</p>\n"
            },
