          "shortText": "<p>For performance reasons, we want to avoid instantiating component buckets for\ncomponents that don&#39;t have an associated component class that we would need\ninstantiate and invoke lifecycle hooks on.</p>\n",
          "text": "<p>In development mode, however, we need to track some state about the component\nin order to produce more useful error messages. This\nTemplateOnlyComponentDebugBucket is only created in development mode to hold\nthat state.</p>\n"
