              "shortText": "<p>The element corresponding to the main element of the component&#39;s template.\nThe main element is the element in the template that has <code>...attributes</code> set on it:</p>\n",
              "text": "<pre><code class=\"lang-hbs\"><span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h1</span>&gt;</span>Modal<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h1</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"contents\"</span> <span class=\"hljs-attr\">...attributes</span>&gt;</span>\n  </span><span class=\"hljs-template-variable\">{{<span class=\"hljs-builtin-name\">yield</span>}}</span><span class=\"xml\">\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span></span>\n</code></pre>\n<p>In this example, <code>this.element</code> would be the <code>div</code> with the class <code>contents</code>.</p>\n<p>You should not try to access this property until after the component&#39;s <code>didInsertElement()</code>\nlifecycle hook is called.</p>\n"
